function ImagePopup(props) {
<div className={`popup popup_type_${props.name} ${props.card ? "popup_opened" : ''}`}>
<figure className={`popup__figure-${props.name}`}>
    <img className={`popup__preview-${props.name}`} src={props.card.link} alt={`${props.card.name}`} />
    <button className="popup__closed-btn" type="button" onClick={props.onClose}></button>
    <figcaption className="popup__title-image">{props.card.name}</figcaption>
</figure>
</div>
}

export default ImagePopup;
